import React, {Component} from 'react';

class Home extends Component {
    render() {
        return (

               <div className="mainContent" id="buttonNav">
                   <button className="btn-primary ml-5">Launch</button>
                   <button className="btn-primary ml-5">Evaluate</button>
                   <button className="btn-primary ml-5 h-25">Reverse Phrase Order</button>
                   <button className="btn-primary ml-2">Set Epochs</button>
               </div>

        );
    }
}

export default Home;
